;; **
;;; ## Example using Iris dataset
;; **

;; @@
(use '(incanter datasets))
(def iris-dataset (get-dataset :iris))

(defn iris-label-to-int
  [string]
  (case string
    "virginica" 0
    "versicolor" 1
    "setosa" 2))

(defn iris-training-gen
  ([] (iris-training-gen 16))
  ([batch-size]
   (map
     (fn [rows]
       (list
         (matrix
           (mapv
             (fn [row]
               (vec (vals (select-keys row [:Sepal.Length :Sepal.Width :Petal.Length :Petal.Width]))))
             rows))
         (mapv #(iris-label-to-int (:Species %)) rows)))
     (repeatedly #(repeatedly batch-size (fn [] (rand-nth (:rows iris-dataset))))))))




(def default-iris-spec
  {:training-generator iris-training-gen
   :iterations 1000
   :batch-size 64
   :architecture {:in 4
                  :hidden [8 4]
                  :out 3}
   :learning-rate 1e-2
   :reg-strength 1e-4})


(make-model default-iris-spec true)
